import Axios from '../../Axios/Axios';

export const handleSignUpAPI = (data) => {
    return new Promise((resolve, reject) => {
        Axios.post('/users/createuser', data) // data is this.state in signup.js
             .then(result => {
                 resolve(result)
             })
             .catch(error => {
                 console.log(error)
                 reject(error)
             })
    })
}
